import ('../css/About.css')

function About() {

    return (
            <div className="container-fluid">
            <div className="position-relative overflow-hidden p-3 p-md-5 m-md-3 text-center bg-light">
            <div className="col-md-5 p-lg-5 mx-auto my-5">
                <h1 className="display-4 fw-normal">The world’s work marketplace</h1>
                <br />
                <p className="lead fw-normal">Our mission to create economic opportunities so people have better lives has taken us so much further. As a result, we’ve become the world’s work marketplace where every day businesses of all sizes and independent talent from around the globe meet here to accomplish incredible things.</p>
                </div>
            </div>

            </div>
)};

export default About
